#!/bin/sh

if [ "$(id -u)" != "0" ]; then
  echo "This script must be run as root" >&2
  exit 1
fi

currentMillis() {
  local ms=$(date +%s%3N)
  echo $((ms))
}

dropCaches() {
  sync; echo 3 > /proc/sys/vm/drop_caches
}

if [ "$#" -ne 3 ]; then
  echo "Usage: $0 <benchmark program> <prefix> <storage device>" >&2
  exit 1
fi

if ! [ -f combine-benchmarks.py ]; then
